import React from "react";
// import logo from './logo.svg';

export default (props) => {
    return(

        <div>
            <h1>{props.data.id}</h1>
            {/* <h2 style={{color:"#fff"}}>I'm very lazy ::::::></h2> */}
            <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </div>
    )
}
